//     <div className="bg-blue-500 p-4">
//       <h1 className="text-white text-3xl font-bold text-center">Hellowww</h1>
//     </div>
//   );
// };

// export default Header;

// import React from "react";

// const Header = () => {
//   return (
//     <div className="bg-blue-500 p-4">
//       <h1 className="text-red-500 text-3xl font-bold text-center">Hellowww</h1>
//     </div>
//   );
// };

// export default Header;

import React, { useState, useEffect } from 'react';
import { FaFacebook, FaTwitter, FaInstagram, FaGithub } from 'react-icons/fa'; // Import React icons
import profileImage from '../assets/p1.jpg';
import g1 from '../assets/g1.jpg';
import g2 from '../assets/g2.jpg';
import g3 from '../assets/g3.jpg';



const Header = () => {
 
const images = [g1, g2, g3];

  const [currentIndex, setCurrentIndex] = useState(0);

  // Handle automatic image rotation every 3 seconds
  useEffect(() => {
    const intervalId = setInterval(() => {
      setCurrentIndex(prevIndex => (prevIndex + 1) % images.length);
    }, 3000); // Change image every 3 seconds

    // Cleanup interval on unmount
    return () => clearInterval(intervalId);
  }, [images.length]);

  return (
    <div className="max-w-sm mx-auto bg-white shadow-xl rounded-lg overflow-hidden mt-8 fade-in transform transition duration-500 hover:scale-105">
      {/* Profile Image */}
      <div className="bg-gradient-to-r from-teal-500 to-blue-500 p-4">
        <img 
          src={profileImage} 
          alt="Profile" 
          className="w-24 h-24 rounded-full mx-auto border-4 border-gray-900" 
        />
      </div>

      {/* Name */}
      <div className="text-center mt-4">
        <h1 className="text-3xl font-bold text-gray-900">Sakthi Kousik R</h1>
        <p className="text-gray-500 italic">"Design, code, innovate, repeat, inspire."</p>
      </div>

      {/* Call-to-Action */}
      <div className="text-center mt-4">
        <a href="#contact" className="bg-teal-500 text-white px-6 py-3 rounded-full hover:bg-teal-600 transition duration-300 ease-in-out">Get in Touch</a>
      </div>

      {/* About Us Section */}
      <div id="about" className="p-6 mt-4">
        <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">About Me</h2>
        <p className="mt-4 text-gray-700">I am a passionate web developer with over 5 years of experience in creating visually stunning and user-friendly websites. My goal is to deliver high-quality work while ensuring client satisfaction.</p>
      </div>

      {/* Social Media Links */}
      <div className="flex justify-center space-x-6 mt-4">
        <a href="https://www.instagram.com/sk_peace__/" className="text-pink-500 hover:text-pink-400 transition transform hover:scale-110">
          <FaInstagram size={30} />
        </a>
        <a href="https://github.com/SAKTHIKOUSIK" className="text-gray-400 hover:text-gray-300 transition transform hover:scale-110">
          <FaGithub size={30} />
        </a>
        <a href="https://www.facebook.com/share/18TpHdQutD/ " className="text-blue-500 hover:text-blue-400 transition transform hover:scale-110">
          <FaFacebook size={30} />
        </a>
        <a href="https://x.com/sakthikousik?t=NY_YDHXGqecKCp3IiZSeZQ&s=09" className="text-blue-400 hover:text-blue-300 transition transform hover:scale-110">
          <FaTwitter size={30} />
        </a>
      </div>

      {/* Carousel Section */}
      <div id="gallery" className="p-6 mt-4">
        <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">Gallery</h2>
        <div className="relative mt-4">
          {/* Carousel Images */}
          <div className="overflow-hidden relative">
            <img 
              src={images[currentIndex]} 
              alt="Gallery Image" 
              className="w-full h-64 object-cover transition-all duration-500"
            />
          </div>
        </div>

        {/* Navigation Button Below Carousel */}
        <div className="text-center mt-4">
          <button 
            className="bg-teal-500 text-white px-6 py-2 rounded-full hover:bg-teal-600 transition duration-300 ease-in-out">
            Next Slide
          </button>
        </div>
      </div>

      {/* Product Section */}
      <div id="products" className="p-6 mt-4">
        <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">Our Products</h2>

        {/* Product 1 */}
        <div className="product-card">
          <h3 className="product-title">Web Development Course</h3>
          <p className="text-gray-600">A comprehensive guide to mastering web development with hands-on projects and real-world applications.</p>
          <p className="product-price">$49.99</p>
        </div>

        {/* Product 2 */}
        <div className="product-card mt-4">
          <h3 className="product-title">Graphic Design Toolkit</h3>
          <p className="text-gray-600">A collection of essential tools and templates for graphic designers, including icons, fonts, and more.</p>
          <p className="product-price">$29.99</p>
        </div>

        {/* Product 3 */}
        <div className="product-card mt-4">
          <h3 className="product-title">Photography E-book</h3>
          <p className="text-gray-600">An in-depth guide on photography techniques, lighting, and editing, perfect for beginners and pros alike.</p>
          <p className="product-price">$19.99</p>
        </div>
      </div>

      {/* Contact Section */}
      <div id="contact" className="p-6 mt-4">
        <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">Contact</h2>
        <p className="mt-4 text-gray-700">Phone: <a href="tel:+1234567890" className="text-teal-500 hover:underline">+123 456 7890</a></p>
        <p className="mt-4 text-gray-700">Email: <a href="mailto:john.doe@example.com" className="text-teal-500 hover:underline">john.doe@example.com</a></p>
      </div>

      {/* Address and Map */}
      <div className="p-6 mt-4">
        <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">Address</h2>
        <p className="mt-4 text-gray-700">123 Main Street, Cityville, Country</p>
        <iframe
          src="https://www.google.com/maps/embed?pb=..."
          width="100%" height="200" style={{ border: 0 }} allowFullScreen="true"
          loading="lazy" className="rounded-md shadow-lg"
        ></iframe>
      </div>

    </div>
  );
}

export default Header;
